import React from 'react';
import { Box, Button, Typography } from '@mui/material';
import { Link } from 'react-router-dom';

const QuestionButton = ({text, onClick, isLastQuestion}) => {
    return (
        isLastQuestion ? 
            <Link 
            to='/quiz-complete'>
                <Button 
                    variant="contained"
                >
                    <Typography variant="h6">
                        {text}
                    </Typography>
                </Button>
            </Link>
            :
        <Box 
            onClick={onClick}
            width='100%'
        >
            <Button 
                variant="contained"
            >
                <Typography variant="h6">
                    {text}
                </Typography>
            </Button>
        </Box>
    )
}

export default QuestionButton
